import React from "react";
import { Swiper, SwiperSlide } from "swiper/react";
import "./style/swiperActual.css";
import { Navigation } from "swiper";
import "swiper/css";
import "swiper/css/navigation";
import "swiper/css/pagination";

import iphone_11_red from "../../image/company/iphone_11_red.png";
export default function App() {
  return (
    <div className="container">
      <Swiper
        navigation={true}
        slidesPerView={4}
        modules={[Navigation]}
        className="mySwiper"
      >
        <SwiperSlide>
          <img src={iphone_11_red} alt="" />
          <div>
            <span>Apple iPhone 13 mini 256GB (PRODUCT) Red</span>
          </div>
        </SwiperSlide>
        <SwiperSlide>
          <img src={iphone_11_red} alt="" />
          <div>
            <span>Huawei Mate 50 Pro 8/256GB Black</span>
          </div>
        </SwiperSlide>
        <SwiperSlide><img src={iphone_11_red} alt="" />
          <div>
            <span>Huawei Mate 50 Pro 8/256GB Black</span>
          </div></SwiperSlide>
        <SwiperSlide><img src={iphone_11_red} alt="" />
          <div>
            <span>Huawei Mate 50 Pro 8/256GB Black</span>
          </div></SwiperSlide>
        <SwiperSlide><img src={iphone_11_red} alt="" />
          <div>
            <span>Huawei Mate 50 Pro 8/256GB Black</span>
          </div></SwiperSlide>
        <SwiperSlide><img src={iphone_11_red} alt="" />
          <div>
            <span>Huawei Mate 50 Pro 8/256GB Black</span>
          </div></SwiperSlide>
        <SwiperSlide>Slide 7</SwiperSlide>
        <SwiperSlide>Slide 8</SwiperSlide>
        <SwiperSlide>Slide 9</SwiperSlide>
      </Swiper>
    </div>
  );
}
